import { Component, OnInit, OnDestroy } from '@angular/core';
import { HttpErrorResponse, HttpResponse } from '@angular/common/http';
import { Subscription } from 'rxjs';
import { JhiEventManager, JhiAlertService } from 'ng-jhipster';

import { ILinhaAerea } from 'app/shared/model/linha-aerea.model';
import { Principal } from 'app/core';
import { LinhaAereaService } from './linha-aerea.service';

@Component({
    selector: 'jhi-linha-aerea',
    templateUrl: './linha-aerea.component.html'
})
export class LinhaAereaComponent implements OnInit, OnDestroy {
    linhaAereas: ILinhaAerea[];
    currentAccount: any;
    eventSubscriber: Subscription;

    constructor(
        private linhaAereaService: LinhaAereaService,
        private jhiAlertService: JhiAlertService,
        private eventManager: JhiEventManager,
        private principal: Principal
    ) {}

    loadAll() {
        this.linhaAereaService.query().subscribe(
            (res: HttpResponse<ILinhaAerea[]>) => {
                this.linhaAereas = res.body;
            },
            (res: HttpErrorResponse) => this.onError(res.message)
        );
    }

    ngOnInit() {
        this.loadAll();
        this.principal.identity().then(account => {
            this.currentAccount = account;
        });
        this.registerChangeInLinhaAereas();
    }

    ngOnDestroy() {
        this.eventManager.destroy(this.eventSubscriber);
    }

    trackId(index: number, item: ILinhaAerea) {
        return item.id;
    }

    registerChangeInLinhaAereas() {
        this.eventSubscriber = this.eventManager.subscribe('linhaAereaListModification', response => this.loadAll());
    }

    private onError(errorMessage: string) {
        this.jhiAlertService.error(errorMessage, null, null);
    }
}
